These six volumes describe the CIA's role in Indochina during the Vietnam War. These histories written by Thomas L. Ahern, Jr., are based on extensive research in CIA records and on oral history interviews of participants. The release totals some 1,600 pages and represents the largest amount of Vietnam-era CIA documents yet declassified.
